import "./ContactMe.css";

const ContactMe = (props) => {
  return(
    <div>
      <p>Interactive Resume: <a href="https://andrewchatch.github.io/interactive-resume/"></a></p>
      <p>Email: <a href="mailto: andrew.hatch96@gmail.com" data-rel="external" target="_blank" rel="noreferrer">andrew.hatch96@gmail.com</a></p>
      <p>LinkedIn: <a href="https://www.linkedin.com/in/andrew-hatch-8b13b0134" target="_blank" rel="noreferrer">linkedin.com/in/andrew-hatch-8b13b0134</a></p>
      <p>Github: <a href="https://github.com/andrewchatch" target="_blank" rel="noreferrer">github.com/andrewchatch</a></p>
      <p>FreeCodeCamp: <a href="https://www.freecodecamp.org/andrewchatch" target="_blank" rel="noreferrer">freecodecamp.org/andrewchatch</a></p>
    </div>
  );
};

export default ContactMe;
